import React, { useEffect } from 'react';

function Home() {
    useEffect(() => {
        typeWriter();
    }, []);

    return (
        <div class="title">
            <h1 id="typeHome"></h1>
        </div>
    );
}

const textHome = "@users/MyronTruesdale: Home";
let index = 0;
const speed = 150; // Typing speed in milliseconds

function typeWriter() {
    if (index < textHome.length) {
        document.getElementById("typeHome").innerHTML += textHome.charAt(index);
        index++;
        setTimeout(typeWriter, speed);
    }
}

export default Home;
